import React, { Fragment } from 'react';
import styled from 'styled-components';
import Header from './components/Header.js';

const AppWrapper = styled.div`
  background-color: #fafafa;
`;
function App() {
  return (
    <Fragment>
      <GlobalStyle />
      <AppWrapper>
        <Header />
        <Profile />
      </AppWrapper>
    </Fragment>
  );
}
export default App;
